import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Navbar = () => {
  const [menuOpen, setMenuOpen] = useState(false);
  const [user, setUser] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const storedUser = localStorage.getItem('user');
    if (storedUser) {
      setUser(JSON.parse(storedUser));
    }
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('user');
    setUser(null);
    setMenuOpen(false);
    navigate('/login');
  };

  return (
    <nav className="sticky top-0 z-50 bg-gradient-to-r from-orange-500 to-pink-500 text-white shadow-lg">
      <div className="max-w-7xl mx-auto flex items-center justify-between px-4 py-3">
        <h1 className="text-2xl font-extrabold tracking-wide drop-shadow">ðŸ“… Booking System</h1>

        {/* Mobile Menu Toggle */}
        <button
          className="md:hidden focus:outline-none"
          onClick={() => setMenuOpen(!menuOpen)}
        >
          <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
            {menuOpen ? (
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
            ) : (
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
            )}
          </svg>
        </button>

        {/* Desktop Links */}
        <div className="hidden md:flex items-center space-x-6 text-sm font-medium">
          <NavItem to="/" label="ðŸ  Home" />
          <NavItem to="/booking" label="ðŸ“† Book" />
          <NavItem to="/dashboard" label="ðŸ“Š Dashboard" />
          <NavItem to="/admin" label="âš™ï¸ Admin" />
          <NavItem to="/businessDashboard" label="ðŸ¢ Business" />
        </div>

        {/* Desktop Auth Buttons */}
        <div className="hidden md:flex items-center space-x-4">
          {user ? (
            <>
              <span className="text-sm">Hi, {user.name || 'User'}</span>
              <button
                onClick={handleLogout}
                className="bg-red-500 hover:bg-red-600 text-white px-3 py-1 rounded transition"
              >
                Logout
              </button>
            </>
          ) : (
            <>
              <Link
                to="/login"
                className="bg-white text-orange-700 px-3 py-1 rounded hover:bg-gray-100 transition"
              >
                Login
              </Link>
              <Link
                to="/signup"
                className="bg-pink-600 text-white px-3 py-1 rounded hover:bg-pink-700 transition"
              >
                Sign Up
              </Link>
            </>
          )}
        </div>
      </div>

      {/* Mobile Dropdown */}
      {menuOpen && (
        <div className="md:hidden bg-pink-600 transition-all duration-300 pb-4 text-center">
          <MobileNavItem to="/" label="ðŸ  Home" setMenuOpen={setMenuOpen} />
          <MobileNavItem to="/booking" label="ðŸ“† Book" setMenuOpen={setMenuOpen} />
          <MobileNavItem to="/dashboard" label="ðŸ“Š Dashboard" setMenuOpen={setMenuOpen} />
          <MobileNavItem to="/admin" label="âš™ï¸ Admin" setMenuOpen={setMenuOpen} />
          <MobileNavItem to="/businessDashboard" label="ðŸ¢ Business" setMenuOpen={setMenuOpen} />

          <hr className="my-3 border-white opacity-30 w-2/3 mx-auto" />

          {user ? (
            <>
              <span className="text-sm block mb-2">Hi, {user.name || 'User'}</span>
              <button
                onClick={handleLogout}
                className="bg-red-500 hover:bg-red-600 text-white px-4 py-1 rounded transition"
              >
                Logout
              </button>
            </>
          ) : (
            <>
              <Link
                to="/login"
                onClick={() => setMenuOpen(false)}
                className="block bg-white text-orange-700 px-4 py-1 my-1 rounded hover:bg-gray-100 transition"
              >
                Login
              </Link>
              <Link
                to="/signup"
                onClick={() => setMenuOpen(false)}
                className="block bg-pink-600 text-white px-4 py-1 rounded hover:bg-pink-700 transition"
              >
                Sign Up
              </Link>
            </>
          )}
        </div>
      )}
    </nav>
  );
};

const NavItem = ({ to, label }) => (
  <Link to={to} className="hover:text-yellow-100 transition">
    {label}
  </Link>
);

const MobileNavItem = ({ to, label, setMenuOpen }) => (
  <Link
    to={to}
    onClick={() => setMenuOpen(false)}
    className="block py-1 hover:text-yellow-100 transition"
  >
    {label}
  </Link>
);

export default Navbar;
